// Restore deleted memberships

// Sync version
var count_restored = 0, restored = [];

var mem_uris = query({
  ticket: veda.ticket,
  query: "'rdf:type'==='v-s:Membership' && 'v-s:deleted'==true",
  limit: 100000,
  top: 100000,
}).result;

mem_uris.map( function (mem_uri) {
  var mem;
  try {
    mem = get_individual(veda.ticket, mem_uri);
  } catch (err) {
    console.log("Error: no membership", mem_uri);
    return;
  }

  var res_uri = getUri( mem["v-s:resource"] );

  var res;
  try {
    res = get_individual(veda.ticket, res_uri);
  } catch (err) {
    console.log("Error: no resource", res_uri);
    return;
  }

  var type_uri = getUri( res["rdf:type"] );
  if ( ["v-s:Appointment", "v-s:Person", "v-s:Position", "v-s:Department"].indexOf(type_uri) >= 0 ) {
    ++count_restored;
    restored.push(mem_uri);
    delete mem["v-s:deleted"];
    put_individual(veda.ticket, mem);
  }
});

console.log("count_restored", count_restored);
console.log("restored", JSON.stringify(restored));



